from ADN import Rosa_ADN

testName = "ADNrosalind"
h=">{0}".format(testName)
seq="AGCTTTTCATTCTGACTGCAACGGGCAATATGTCTCTGTGTGGATTAAAAAAAGAGTGTCTGATAGCAGC"
iRosa_ADN = Rosa_ADN(h, seq)
result = iRosa_ADN.ADNcount()
exp_str = "20 12 17 21"
if result == exp_str :
    print(".\n")
else :
    print("error at {0} : {1}\n".format(testName, result))
    
